'''[[馬達加斯加]]'''是一个岛国，位于靠近非洲东海岸不远处。
马达加斯加还可以指： ==体育== * [[马达加斯加国家足球队]] * [[马达加斯加国家橄榄球联合会队]] * [[马达加斯加戴维斯杯网球队]] * [[马达加斯加联合会杯队]] * [[马达加斯加国家女子篮球队]] ==娱乐== * [[马达加斯加系列电影]]：一个动画电影系列。 ** [[马达加斯加 (2005年电影)‎]]：该系列电影的第一部。 *** [[马达加斯加 (原声碟)]]：该电影的原声碟 *** [[马达加斯加 (视频游戏)]]：该电影的游戏 ** [[马达加斯加2]]：以上动画电影的续集。 ** [[马达加斯加3]]：以上动画电影的续集,2012年电影。 ** [[馬達加斯加 (電視版)]]:電視版 * 《马达加斯加》是[[枪花]]的[[民主大中国]]专辑中的一首歌。 * 《马达加斯加》是[[西蒙·贝瑞]]的一首[[摇头风]]歌曲，由费利·高士顿和理查德·杜兰德混音。
==船舰== * [[马达加斯加号]]，19世纪的英国商船。 * [[马达加斯加 (1811年)]]，1811年出航的皇家海军舰艇。 * [[马达加斯加 (1822年)]]，1822年出航的皇家海军护卫舰。 ==电视== * [[马达加斯加的企鹅]]，尼克动画于2009年推出的系列动画。 * [[馬達加斯加奇觀]]，2011年[[英國廣播公司]]紀錄片。 {{disambig|Cat=五字消歧义}}
